import React from "react";
import "./App.css";
import pokemons from "./data";
import Pokedex from "./Pokedex";
import { BrowserRouter, Route, Switch } from "react-router-dom";

class App extends React.Component {
  render() {
    return (
      <BrowserRouter>
        <Switch>
          <Route
            exact
            path="/"
            render={() => <Pokedex pokemons={pokemons} />}
          />
        </Switch>
      </BrowserRouter>
    );
  }
}

export default App;
